import React from 'react';
import TabContents from "./TabContents";

const Tablists = props => {
    const {children} = props;
    return (
        <ul>
            {children.map(list => {
                const {label} = list.props;

                return (
                    <TabContents
                        label={label}
                        key={label}
                    />
                )
            })}
        </ul>
    )
}

export default Tablists;
